/**
 * Definition for singly-linked list.
 */
#include "list.h"
#include <stdio.h>

void PrintListArray(struct ListNode* node_arr[], int n)
{
    for (int i = 0; i < n; ++i)
    {
        printf("%d ", node_arr[i]->val);
    }
    printf("\n");
}

void swap(int* x, int* y)
{
    int tmp = *x;
    *x = *y;
    *y = tmp;
}

struct ListNode* Partition(struct ListNode* begin, struct ListNode* end)
{
    int key = begin->val;
    struct ListNode* p = begin;
    struct ListNode* q = p->next;
    while(q != end)
    {
        if (q->val < key)
        {
            p = p->next;
            swap(&(p->val), &(q->val));
        }
        q = q->next;
    }
    swap(&(begin->val), &(p->val));
    return p;
}

void QuickSort(struct ListNode* begin,  struct ListNode* end)
{
    if (begin != end)
    {
        struct ListNode* x = Partition(begin, end);
        QuickSort(begin, x);
        QuickSort(x->next, end);
    }
}

struct ListNode* sortList(struct ListNode* head)
{
    if (NULL == head)
    {
        return head;
    }
    QuickSort(head, NULL);
    return head;
}

